    @Secured("ROLE_MANAGER")
    @RequestMapping(value = "/printshops/{id}/pricetable/deletering", method = RequestMethod.POST)
    public String deleteRingItem(@PathVariable(value = "id") long id, @RequestBody RingTableItem rti) {
